import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Dashboard.css'; // Link to your CSS file

import headbg from './Images/header_bg.jpg';
import wesafelogo from './Images/wesafe_Logo.png';
import userprofile from './Images/avatar.png';
import toggleIcon from './Images/toggle_menu.png';

const Dashboard = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Logout logic goes here
    navigate('/login'); // Adjust the route as necessary
  };

  return (
    <header className="header" style={{ backgroundImage: `url(${headbg})` }}>
      <img src={toggleIcon} alt="Toggle Menu" className="toggle-icon" onClick={handleLogout}/>
      <img src={wesafelogo} alt="We-Safe" className="logo"/>
      <img src={userprofile} alt="User" className="user-profile"/>
      <button onClick={handleLogout} className="logout-button">LOGOUT</button>
    </header>
  );
};

export default Dashboard;
